import React from "react";

function ViewMainList(props) {

    return (
        <div className={'container'}>
            <div className={'row'}>
                <div className={'col-sm'}>
                    <img src={'/image/1.png'} />
                </div>
                <div className={'col-sm'}>

                </div>
                <div className={'col-sm'}>
                    <button type={'button'} className={'btn'} name={''}>중고도서보기</button>
                    <button type={'button'} className={'btn'} name={''}>중고도서판매하기</button>
                </div>
            </div>
        </div>
    )
}

export default ViewMainList;
